fields.description:
Фрукты (от лат. fructus — плод) — это съедобные сочные плоды культурных и дикорастущих растений.
Фрукты содержат легкоусвояемые углеводы, витамины, органические кислоты и другие вещества, которые используются в питании человека, в том числе в диетическом. Их употребляют свежими, консервируют, сушат, замораживают.
Фрукты принято подразделять на:
-семечковые (айва, груша, яблоко и др.);
-косточковые (вишня, слива, персик и др.);
-цитрусовые (апельсин, грейпфрут, лимон и др.);
-субтропические и тропические (ананас, банан, гранат, инжир, манго и др.);
-ягоды (малина, крыжовник, виноград и др.).
